import React, { useState, useEffect } from "react";
import FullCalendar from "@fullcalendar/react";
import dayGridPlugin from "@fullcalendar/daygrid";
import { formatDate } from "@fullcalendar/common";
import Widget from "../../components/Widget/Widget";
import { Calendar } from '@fullcalendar/core';
import interactionPlugin, { Draggable } from '@fullcalendar/interaction';
import timeGridPlugin from '@fullcalendar/timegrid';

const Reservation = () => {

  return (
    <>
      <Widget title={<p style={{ fontSize:30, fontWeight: 700 }}>프로젝트룸</p>}>
        <FullCalendar plugins={[ timeGridPlugin, interactionPlugin ]} initialView="timeGridWeek"
        timeZone="Asia/Seoul"
headerToolbar= {{
  left: 'prev,next today',
  center: 'title',
  right: 'timeGridWeek,timeGridDay'
}}
    events={[
      { title: 'event 1', start: 'Wed, 01 Dec 2021 03:24:54 GMT', end: 'Wed, 01 Dec 2021 08:24:54 GMT' },
    ]}
    // allDaySlot={false}
    />
      </Widget>
    </>
  );
};

export default Reservation;
